import React from "react";
import "../Navigation/Navigation2.scss";
import {Navbar, Nav} from 'react-bootstrap';
class Navigation_2 extends React.Component {
  render() {
    return (
      <div className="nav-left">

<nav className="nav-bar">
       <ul>
         <li><a  className="nav-link" href="">Overview</a></li>
         <li><a className="nav-link" href="">Account Info</a></li>
         <li><a className="nav-link" href="">Orders</a></li>
         <li><a className="nav-link" href="">Refunds</a></li>
         <li><a className="nav-link" href="">Message Center</a></li>
         <li><a className="nav-link" href="">Track Orders</a></li>
         <li><a className="nav-link" href="">Statistic</a></li>
         <li><a className="nav-link" href="">Help</a></li>
         <li><a className="nav-link" href="">Log-out</a></li>
       </ul>
     </nav>
        </div>
    );
  }
}

export default Navigation_2;
